% addpath(genpath('b-spline'))
syms s S S2 S3 x0 dx0 ddx0 x1 dx1 ddx1 c0 c1 c2 c3 c4 c5
syms a0 a1 a2 a3 a4 a5
order = 5;
%% first method direct solve
P = sym(zeros(order+1,order+1));
% start cond & end con
for i = 0:floor(order/2)
    P(i+1,i+1) = factorial(i);
    for j = i:order
       s_term = S^(j-i);
       P(i+1+floor(order/2)+1,j+1) = factorial(j)/factorial(j-i).*s_term;
    end
end
X = [x0 dx0 ddx0 x1 dx1 ddx1].';
% solve for coeffs C of the poly d(s)=C1+C2*s+...+C6*s^5
% P * C = X, C = P^(-1)*X
C = P^(-1)*X;
% prove that it's equal to xpilot code
S2 = S^2;
S3 = S^3;
c0 = (x1-0.5*S2*ddx0-dx0*S-x0)/S3;
c1 = (dx1-ddx0*S-dx0)/S2;
c2 = (ddx1-ddx0)/S;
C4 = 0.5*(20*c0-8*c1+c2);
C5 = (-15*c0+7*c1-c2)/S;
C6 = (6*c0-3*c1+0.5*c2)/S2;
C4 = simplify(subs(C4)); % proved is equal to simplify(C(4))
C5 = simplify(subs(C5)); % proved is equal to simplify(C(5))
C6 = simplify(subs(C6)); % proved is equal to simplify(C(6))
% if we want end condition x1 only
flag_end_zero = 1;
if flag_end_zero == 1
    dx1 = 0;
    ddx1 = 0;
end
for i = 4:6
    C(i) = simplify(subs(C(i)));
end
% get roots of the eqn dd(s)/ds = 0
s_set = sym(ones(order+1,1));
for i = 1:order
    s_set(i+1) = s^(i);
end
PolyS = (C.'*s_set).';
dPolyS = diff(PolyS,s);
[coeffs_dj,s_set1] = coeffs(dPolyS,s);
coeffs_dj = flip(coeffs_dj);
coeffs_matlab = flip(coeffs_dj);
roots_matlab = roots(coeffs_matlab);
flag = 1;
if flag == 1
    root_set = get_roots(coeffs_dj);
else
    root_set = roots_matlab;
end
% diary('log_files.txt')
