a2 = C(3);a3 = C(4);a4 = C(5);a5 = C(6);
% s_max_set = subs(root_set2); % subs with x0 dx0 ddx0
s_max_set = root_set2;
d3_poly_s = diff(poly_s,s,3); % 3rd order poly
