% coeffs_poly_3rd_deri = subs(coeffs_poly_3rd_deri); % subs with x0 dx0 ddx0
poly_s_temp = [s_max_set^2 s_max_set 1];
jerk_max_set = poly_s_temp * coeffs_poly_3rd_deri.';
% wrong jerk_max = (12*(3*ddx0*S^2 + 16*dx0*S + 30*x0 - 30*x1)^2)/(5*S^3*(ddx0*S^2 + 6*dx0*S + 12*x0 - 12*x1)) - (12*(3*ddx0*S^2 + 16*dx0*S + 30*x0 - 30*x1))/S^4 - (3*(3*ddx0*S^2 + 12*dx0*S + 20*x0 - 20*x1))/S^3;
jerk_max = (6*(3*ddx0*S^2 + 16*dx0*S + 30*x0 - 30*x1)^2)/(5*S^3*(ddx0*S^2 + 6*dx0*S + 12*x0 - 12*x1)) - (3*(3*ddx0*S^2 + 12*dx0*S + 20*x0 - 20*x1))/S^3;
fs = finverse(jerk_max, S);


