%% functions
function root_set = get_roots(coeffs)

coeffs = coeffs./coeffs(max(size(coeffs))); % we need to normalize coeff(n_order)
n = max(size(coeffs))-1;
CM = sym(diag(ones(n-1,1),-1));
for i = 1:n
    CM(i,n) = -coeffs(i);
end
fprintf(1,'rank of C: %d\n',rank(CM));
root_set = eig(CM); % possible values of xf/T
assignin('base','roots',root_set)

end

function root_set = get_roots_nosym(coeffs)

coeffs = coeffs./coeffs(max(size(coeffs))); % we need to normalize coeff(n_order)
n = max(size(coeffs))-1;
CM = diag(ones(n-1,1),-1);
for i = 1:n
    CM(i,n) = -coeffs(i);
end
fprintf(1,'rank of C: %d\n',rank(CM));
root_set = eig(CM); % possible values of xf/T
assignin('base','roots',root_set)
assignin('base','CM',CM)

end

function [d_max_root_set,coeffs] = cal_d_max(S,x0,dx0,ddx0,x1,dx1,ddx1)

a0 =  x0;
a1 = dx0;
a2 =  ddx0/2;
a3 = -(20*x0 - 20*x1 + 12*S*dx0 + 8*S*dx1 + 3*S^2*ddx0 - S^2*ddx1)/(2*S^3);
a4 = (30*x0 - 30*x1 + 16*S*dx0 + 14*S*dx1 + 3*S^2*ddx0 - 2*S^2*ddx1)/(2*S^4);
a5 =  -(12*x0 - 12*x1 + 6*S*dx0 + 6*S*dx1 + S^2*ddx0 - S^2*ddx1)/(2*S^5);
coeffs = [a0,a1,a2,a3,a4,a5].';
coeffs_deri = [a1,2*a2,3*a3,4*a4,5*a5];
