function [dydx] = cal_dydx_value(coeff, x, n)
dydx = n * coeff(1);
for i = 2:n
    dydx = dydx * x + (n-i+1) * coeff(i);
end
end

function [d2ydx2] = cal_d2ydx2_value(coeff, x, n)
d2ydx2 = n * (n-1) * coeff(1);
for i = 3:n
    d2ydx2 = d2ydx2 * x + (n-i+2) * (n-i+1) * coeff(i-1);
end
end

function [d3ydx3] = cal_d3ydx3_value(coeff, x, n)
d3ydx3 = n * (n-1) * (n-2) * coeff(1);
for i = 4:n
    d3ydx3 = d3ydx3 * x + (n-i+3) * (n-i+2) * (n-i+1) * coeff(i-2);
end
end

function [d4ydx4] = cal_d4ydx4_value(coeff, x, n)
d4ydx4 = n * (n-1) * (n-2) * (n-3) * coeff(1);
for i = 5:n
    d4ydx4 = d4ydx4 * x + (n-i+4) * (n-i+3) * (n-i+2) * (n-i+1) * coeff(i-3);
end
end

function [d1_range, d2_range, d3_range, d4_range, kappa_set, dkappa_set, xkappa_set, xdkappa_set] = compute_ds(coeffs_d, s_range)

d_range = polyval(flip(coeffs_d),s_range);
d1_range = s_range;
d2_range = s_range;
d3_range = s_range;
d4_range = s_range;
kappa_set = s_range;
dkappa_set = s_range;
xkappa_set = s_range;
xdkappa_set = s_range;
for i = 1:length(s_range)
    % method 1
%     d1_range(i) = cal_dydx_value(flip(coeffs_d),s_range(i),5);
%     d2_range(i) = cal_d2ydx2_value(flip(coeffs_d),s_range(i),5);
%     d3_range(i) = cal_d3ydx3_value(flip(coeffs_d),s_range(i),5); 
%     d4_range(i) = cal_d4ydx4_value(flip(coeffs_d),s_range(i),5); 
    % method 2
    coeffs_deri = polyder(flip(coeffs_d));
    d1_range(i) = polyval(coeffs_deri,s_range(i));
    coeffs_dderi = polyder(coeffs_deri);
    d2_range(i) = polyval(coeffs_dderi,s_range(i));
    coeffs_ddderi = polyder(coeffs_dderi);
    d3_range(i) = polyval(coeffs_ddderi,s_range(i));
    coeffs_dddderi = polyder(coeffs_ddderi);
    d4_range(i) = polyval(coeffs_dddderi,s_range(i));
    
    kappa_set(i) = compute_curvature_dydx(d1_range(i),d2_range(i));
    dkappa_set(i) = compute_curvature_deri_dydx(d1_range(i),d2_range(i),d3_range(i));
    
    rkappa = 0.002; % 500m radius
    rdkappa = 0;
    rddkappa = 0;
    xkappa_set(i) = compute_xkappa(rkappa,rdkappa,d_range(i),d1_range(i),d2_range(i));
    xdkappa_set(i) = compute_xdkappa(rkappa,rdkappa,rddkappa,d_range(i),d1_range(i),d2_range(i),d3_range(i));
end

end

function [d2_s_max,d2_max_result] = find_larger_kappa_s(kappa_limit, x0, dx0, ddx0, x1, dx1, ddx1)
% a0 = coeff(1);a1 = coeff(2);a2 = coeff(3);a3 = coeff(4);a4 = coeff(5);a5 = coeff(6);
d2_max_result = 0;
d2_s_max = 2;
for S = 2:2:500
    a0 =  x0;
    a1 = dx0;
    a2 =  ddx0/2;
    a3 = -(20*x0 - 20*x1 + 12*S*dx0 + 8*S*dx1 + 3*S^2*ddx0 - S^2*ddx1)/(2*S^3);
    a4 = (30*x0 - 30*x1 + 16*S*dx0 + 14*S*dx1 + 3*S^2*ddx0 - 2*S^2*ddx1)/(2*S^4);
    a5 =  -(12*x0 - 12*x1 + 6*S*dx0 + 6*S*dx1 + S^2*ddx0 - S^2*ddx1)/(2*S^5);

    s0 =  -(2*a4 - 5*((4*a4^2)/25 - (2*a3*a5)/5)^(1/2))/(10*a5);
    s1 =  -(2*a4 + 5*((4*a4^2)/25 - (2*a3*a5)/5)^(1/2))/(10*a5);
    d2_0 =  (50*a2*a5^2 - 2*2^(1/2)*(2*a4^2 - 5*a3*a5)^(3/2) + 8*a4^3 - 30*a3*a4*a5)/(25*a5^2);
    d2_1 =  (50*a2*a5^2 + 2*2^(1/2)*(2*a4^2 - 5*a3*a5)^(3/2) + 8*a4^3 - 30*a3*a4*a5)/(25*a5^2);
    d2_max = max(abs(d2_0),abs(d2_1));
    if d2_max < kappa_limit
        d2_max_result = d2_max;
        d2_s_max = S;
        break
    end
end

end

function [d3_s_max,d3_max_result] = find_larger_dkappa_s(dkappa_limit, x0, dx0, ddx0, x1, dx1, ddx1)
% a0 = coeff(1);a1 = coeff(2);a2 = coeff(3);a3 = coeff(4);a4 = coeff(5);a5 = coeff(6);
d3_max_result = 0;
d3_s_max = 2;
for S = 2:2:500
    a0 =  x0;
    a1 = dx0;
    a2 =  ddx0/2;
    a3 = -(20*x0 - 20*x1 + 12*S*dx0 + 8*S*dx1 + 3*S^2*ddx0 - S^2*ddx1)/(2*S^3);
    a4 = (30*x0 - 30*x1 + 16*S*dx0 + 14*S*dx1 + 3*S^2*ddx0 - 2*S^2*ddx1)/(2*S^4);
    a5 =  -(12*x0 - 12*x1 + 6*S*dx0 + 6*S*dx1 + S^2*ddx0 - S^2*ddx1)/(2*S^5);

    d3_max = abs(6*a3 - (12*a4^2)/(5*a5));
    if d3_max < dkappa_limit
        d3_max_result = d3_max;
        d3_s_max = S;
        break
    end
end

end

function [xkappa] = compute_xkappa(rkappa,rdkappa,l,dl,ddl)

denominator = (dl * dl + (1 - l * rkappa) * (1 - l * rkappa));
if abs(denominator) < 1e-8 
    xkappa = 0;
    return
end
 
denominator = denominator^(1.5);
numerator = rkappa + ddl - 2 * l * rkappa * rkappa - l * ddl * rkappa + l * l * rkappa * rkappa * rkappa + l * dl * rdkappa + 2 * dl * dl * rkappa;
xkappa = numerator / denominator;

end

function [xdkappa] = compute_xdkappa(rkappa,rdkappa,rddkappa,l,dl,ddl,dddl)

kappa = 0;
denominator = (dl * dl + (1 - l * rkappa) * (1 - l * rkappa));
if abs(denominator) > 1e-8 
    denominator = denominator^(1.5);
    numerator = rkappa + ddl - 2 * l * rkappa * rkappa - l * ddl * rkappa + l * l * rkappa * rkappa * rkappa + l * dl * rdkappa + 2 * dl * dl * rkappa;
    kappa = numerator / denominator;
end
 
one_minus_l_rk = 1 - rkappa * l;
one_minus_l_rk_prime = -(rdkappa * l + rkappa * dl);
one_minus_l_rk_dprime = -(ddl * rkappa + 2.0 * dl * rdkappa + l * rddkappa);

tan_theta_diff = dl / one_minus_l_rk;
theta_diff = atan2(dl, one_minus_l_rk);
cos_theta_diff = cos(theta_diff);
cos_theta_diff_2 = cos_theta_diff * cos_theta_diff;
cos_theta_diff_3 = cos_theta_diff_2 * cos_theta_diff;
theta_diff_prime = kappa * one_minus_l_rk / cos_theta_diff - rkappa;

theta_diff_dprime = (dddl - one_minus_l_rk_dprime * tan_theta_diff - 2.0 * one_minus_l_rk_prime * theta_diff_prime / cos_theta_diff_2) * cos_theta_diff_3 / one_minus_l_rk;
theta_diff_dprime = (theta_diff_dprime + 2.0 * theta_diff_prime * theta_diff_prime) / cos_theta_diff;
res = theta_diff_dprime + rdkappa - kappa * (one_minus_l_rk_prime + one_minus_l_rk * tan_theta_diff * theta_diff_prime) / cos_theta_diff;
res = res * cos_theta_diff_2 / (one_minus_l_rk * one_minus_l_rk);

xdkappa = res;

end

function [kappa] = compute_curvature_dydx(dydx,d2ydx2)
% compute curvature
den = sqrt((1+dydx^2)^3);
kappa = d2ydx2 / den;
end

function [dkappa] = compute_curvature_deri_dydx(dydx,d2ydx2,d3ydx3)
% compute curvature derivative
a = sqrt(1+dydx^2);
dkappa = d3ydx3*a^(-4)-3*dydx*d2ydx2^2*a^(-6);
end
